def distance(a, b):
    return (a[0] - b[0]) ** 2 + (a[1] - b[1]) ** 2


def rotate(a, b):
    return abs(a[0] * b[1] - a[1] * b[0])


def arc(a, b):
    return 0.5 * rotate(a, b)


def touch_point(image):
    x = sum(i * (image[i] == 'X') for i in range(len(image))) / len(image)
    y = sum(i * (image[i] == 'X') for i in range(len(image))) / len(image)
    return [x, y]


def grip(image):
    return [touch_point(image) for i in range(len(image)) if image[i] == 'X']


def touch_vectors(grip1, grip2):
    return [(grip2[i][0] - grip1[i][0], grip2[i][1] - grip1[i][1]) for i in
        range(len(grip1))]


def grip_rotation(touch_vectors):
    sum = 0
    for i in range(len(touch_vectors)):
        sum += rotate(touch_vectors[i], touch_vectors[(i + 1) % len(
            touch_vectors)])
    return sum / len(touch_vectors)


