    image1 = input().split()
    image2 = input().split()
    grip1 = grip(image1)
    grip2 = grip(image2)
    touch_vectors1 = touch_vectors(grip1, grip2)
    touch_vectors2 = touch_vectors(grip2, grip1)
    grip1_spread = sum(distance(grip1[i], grip1[0]) for i in range(len(grip1)))
    grip2_spread = sum(distance(grip2[i], grip2[0]) for i in range(len(grip2)))
    pan = abs(distance(grip1[0], grip2[0]))
    zoom = abs(grip1_spread - grip2_spread)
    rotate = abs(grip_rotation(touch_vectors1) - grip_rotation(touch_vectors2))
    if pan > zoom and pan > rotate:
        print(len(grip1), 'pan')
    elif zoom > pan and zoom > rotate:
        print(len(grip1), 'zoom', 'out' if grip2_spread < grip1_spread else 'in')
    elif rotate > pan and rotate > zoom:
        print(len(grip1), 'rotate', 'clockwise' if grip_rotation(touch_vectors1
            ) > 0 else 'counter-clockwise')


